import { Routes, Route } from "react-router-dom"
import Form from "./Form"
import Progressbar from "./Progressbar"

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="Form" element={<Form />} />
        <Route path="Progressbar" element={<Progressbar />} />
      </Routes>
    </div>
  )
}

export default App;
